import React, { useState, useCallback, useEffect } from "react";
const App = () => {
  const [count, setCount] = useState(0);
  const increment = () => {
    setCount(count + 1);
  };

  return (
    <div>
      <div> Hello World</div>
      <br />
      <div>Increment</div>
      <br />
      <button
        onClick={useCallback(() => {
          this.increment();
        }, [count])}
      >
        {count}
      </button>
    </div>
  );
};

export default App;
